import styled from 'styled-components'

const Container = styled.div`
  position: relative;
  display: flex;
  justify-content: center;
  width: 100vw;
  height: 100vh;
  overflow: hidden;
`

const Header = styled.div`
  position: fixed;
  top: 0;
  width: 100%;
  height: 50px;
  background-color: red;
`

// ({ children }) => () =>
//   console.log('=>>>>>>>', children) || (
//     <Container>
//       <Header />
//       {children}
//     </Container>
//   )

export default ({ children }) =>
  console.log('=>>>>>>>', children) || (
    <Container>
      <Header />
      {children}
    </Container>
  )
